[CmdletBinding()]
param (
    [string]$Arch,

    [switch]$CSV,
    [switch]$XML,
    [switch]$Open,

    [Alias("h", "?")]
    [switch]$ShowHelp,

    [string]$Include,

    [hashtable]$Whitelist,  

    [switch]$Console,

    [switch]$All
)

function Show-Help {
    Write-Host "`n"
    @"
Autorun Hunter - Hunting suspicious and malicious autoruns.


[ Synopsis ]

  This script enumerates autoruns using Sysinternals Autorunsc.exe, 
  automatically flags and filters for suspicious entries,
  and outputs the findings in console, CSV, or Excel format.

[ Parameters ]

  -Include    Comma-separated strings to add to known bad list
  -Whitelist  Key/value pairs to add to global whitelist ("Value" = "Field")
  -Console    Show suspicious entries in colored console output
  -CSV        Export suspicious entries to CSV in the temp folder
  -XML        Export suspicious entries to Excel (.xlsx) via COM automation
  -Open       Open the exported file(s) after creation
  -All        Return all entries, disables filtering
  -h, -?      Show this help message

[ Examples ]

  .\AutorunHunter.ps1 -CSV -Console
  .\AutorunHunter.ps1 -Include "rundll32,mshta" -Verbose -CSV
  .\AutorunHunter.ps1 -Whitelist @{ "Custom Corp" = "Signer"; "Example Inc" = "Entry" } -CSV

"@
    Write-Host "`n"
    exit 0
}

if ($ShowHelp) { Show-Help }

function Write-VerboseLog {
    if ($Verbose) { Write-Host "[*] $($args -join ' ')" -ForegroundColor Cyan }
}

function Detect-Architecture {
    if ([Environment]::Is64BitOperatingSystem) {
        if ($env:PROCESSOR_ARCHITEW6432) {
            return "x64a" 
        } else {
            return "x64"
        }
    } else {
        return "x86"
    }
}


function Extract-AutorunsExe {
    param ([string]$arch)
    $temp = [System.IO.Path]::GetTempPath()  # Get the temporary path
    $timestamp = (Get-Date).ToString("yyyyMMddHHmmss")  # Generate a timestamp for uniqueness
    $zipFile = Join-Path $temp "Sysinternals-Autoruns-Temp-$timestamp.zip"
    $exePath = Join-Path $temp "autorunsc64.exe"  # Adjusted to reflect actual expected executable name

    # Write-Host "[DEBUG] Temp Path: $temp"
    # Write-Host "[DEBUG] Zip File Path: $zipFile"
    # Write-Host "[DEBUG] Executable Path: $exePath"

    if ($arch -ne "x64") {
        Write-Host "Warning: ARCH conflict with embedded EXE. [$arch Detected]"
    }
    
    $b64 = ""

    try {
        # Write-Host "[DEBUG] Writing zip file from Base64 string..."
        [IO.File]::WriteAllBytes($zipFile, [Convert]::FromBase64String($b64))

        # Write-Host "[DEBUG] Adding System.IO.Compression.FileSystem assembly..."
        Add-Type -AssemblyName System.IO.Compression.FileSystem

        # Write-Host "[DEBUG] Extracting zip file..."
        if (Test-Path $exePath) {
            Remove-Item $exePath -Force
        }
        [System.IO.Compression.ZipFile]::ExtractToDirectory($zipFile, $temp)

        # Write-Host "[DEBUG] Removing zip file..."
        Remove-Item $zipFile -Force
    } catch {
        Write-Error "Failed during extraction process: $_"
    }

    if (-Not (Test-Path $exePath)) {
        Write-Error "Executable not found: $exePath"
    } else {
        #Write-VerboseLog "Using executable: $exePath"
    }

    return $exePath
}

    

function Find-ExcelPath {
    $paths = @(
        "$env:ProgramFiles\Microsoft Office",
        "$env:ProgramFiles (x86)\Microsoft Office",
        "$env:ProgramW6432\Microsoft Office"
    )
    foreach ($p in $paths) {
        $exe = Get-ChildItem -Path $p -Recurse -Filter excel.exe -ErrorAction SilentlyContinue | Select-Object -First 1
        if ($exe) { return $exe.FullName }
    }
    return $null
}

function ColorWrite-Suspicious {
    param ([psobject[]]$Entries)

    Write-Host "`n------------- [ $($Entries.Count) AUTORUNS ]--------------`n" -ForegroundColor Green

    foreach ($entry in $Entries) {

        Write-Host ("Flag:".PadRight(17)) -NoNewline; Write-Host $entry.Flag -ForegroundColor Red
        Write-Host ("Location:".PadRight(17)) -NoNewline; Write-Host $entry.'Entry Location'
        Write-Host ("Entry:".PadRight(17)) -NoNewline; Write-Host $entry.Entry
        Write-Host ("Enabled:".PadRight(17)) -NoNewline; Write-Host $entry.Enabled 
        Write-Host ("Category:".PadRight(17)) -NoNewline; Write-Host $entry.Category
        Write-Host ("Profile:".PadRight(17)) -NoNewline; Write-Host $entry.Profile 
        Write-Host ("Description:".PadRight(17)) -NoNewline; Write-Host $entry.Description
        Write-Host ("Signer:".PadRight(17)) -NoNewline; Write-Host $entry.Signer 
        Write-Host ("Image Path:".PadRight(17)) -NoNewline; Write-Host $entry.'Image Path' 
        Write-Host ("Launch String:".PadRight(17)) -NoNewline; Write-Host $entry.'Launch String' 

        foreach ($prop in $entry.PSObject.Properties.Name) {
            if ($prop -like 'SHA-1') {
                Write-Host ($prop + ":").PadRight(17) -NoNewline; Write-Host $entry.$prop 
            }
        }

        Write-Host "`n--------------------------`n" 
    }
    Write-Host "`n------------- [ $($Entries.Count) AUTORUNS ]--------------`n" -ForegroundColor Green
}

function Check-AdminPrivilege {
    Write-Host "`n[ Autorun Hunter ]`n[ github.com\blwhit ]`n"
    if (([System.Security.Principal.WindowsIdentity]::GetCurrent().Groups -match 'S-1-5-32-544')) {
        Write-Host "- Running as admin " -ForegroundColor Yellow
    }
    else {
        Write-Host "- Running in unprivileged context " -ForegroundColor Yellow
    }
}

# === Main Script Execution ===

Check-AdminPrivilege

if (-not $CSV -and -not $XML -and -not $Console) {
    $Console = $true
}

try {
    # Try to detect architecture if not passed explicitly
    $resolvedArch = if ($Arch) { 
        $Arch 
    } else { 
        Detect-Architecture 
    }

    $exePath = Extract-AutorunsExe -arch $resolvedArch

    Write-VerboseLog "Running autorunsc to enumerate autoruns..."
    $rawOutput = & $exePath -a * -c -h -m -s -t * -accepteula -nobanner 2>$null

    if (-not $rawOutput) {
        throw "No output received from autorunsc execution."
    }

    $data = $rawOutput | ConvertFrom-Csv
    if (-not $data -or $data.Count -eq 0) {
        throw "No autorun entries parsed from autorunsc output."
    }

} catch {
    Write-Error "Failed to enumerate autoruns: $_"
    exit 1
} finally {
    # Clean up the temporary executable
    if (Test-Path $exePath) {
        Remove-Item $exePath -Force -ErrorAction SilentlyContinue
    }
}

# Clean unwanted columns if they exist
$colsToRemove = @("MD5", "SHA-256", "PESHA-256", "PESHA-256", "SHA-256")
foreach ($row in $data) {
    foreach ($col in $colsToRemove) {
        if ($row.PSObject.Properties[$col]) {
            $row.PSObject.Properties.Remove($col) | Out-Null
        }
    }
}

# Capture current script execution time for all entries
$currentDate = (Get-Date -Format 'yyyy-MM-dd')
$currentTime = (Get-Date -Format 'HH:mm:ss')

foreach ($row in $data) {
    $metaTime = $row.Time
    $row.PSObject.Properties.Remove("Time")
    $row | Add-Member -NotePropertyName Meta_UTC -NotePropertyValue $metaTime -Force
    $row | Add-Member -NotePropertyName Time -NotePropertyValue $currentTime -Force
    $row | Add-Member -NotePropertyName Date -NotePropertyValue $currentDate -Force
    $row | Add-Member -NotePropertyName Hostname -NotePropertyValue $env:COMPUTERNAME -Force
}

