)

# Global Whitelist by string and field (Entry Location, Entry, Enabled, Category, Profile, Description, Signer, Company, Image Path, Version, Launch String, SHA-1, PESHA-1, IMP) #
$GlobalWhitelistExclusions = @{
    "VMware, Inc." = "Signer";
    "\Microsoft\Windows\SMB\UninstallSMB1ClientTask" = "Entry";
    "\Microsoft\Windows\SMB\UninstallSMB1ServerTask" = "Entry"
}

# Add user-defined whitelist entries
if ($Whitelist) {
    foreach ($key in $Whitelist.Keys) {
        $GlobalWhitelistExclusions[$key] = $Whitelist[$key]
    }
    Write-VerboseLog "User added global whitelist entries: $($Whitelist.Keys -join ', ')"
}

function IsWhitelisted {
    param ($entry)
    foreach ($wl in $GlobalWhitelistExclusions.Keys) {
        $field = $GlobalWhitelistExclusions[$wl]
        $val = $entry.$field
        if ($val -and $val.ToLower().Contains($wl.ToLower())) {
            return $true
        }
    }
    return $false
}

# Global 'unsigned' whitelist
$SignatureWhitelistExclusions = @{
    "Codecs" = "Category";
    "7-Zip Shell Extension" = "Description";
    "(Not verified) Broadcom Corporation" = "Signer";
    "diff-ext-for-kdiff3-64" = "Entry";
    "Te.Service" = "Entry"
}

function IsSignatureWhitelisted {
    param (
        [Parameter(Mandatory=$true)]
        $entry
    )
    foreach ($wl in $SignatureWhitelistExclusions.Keys) {
        $field = $SignatureWhitelistExclusions[$wl]
        $val = $entry.$field
        if ($val -and $val.ToLower().Contains($wl.ToLower())) {
            return $true
        }
    }
    return $false
}

function Get-FlagReason {
    param ($entry)

    $reasons = @()

    $hasHash = ($entry.PSObject.Properties.Name | Where-Object { $_ -like '*SHA*' -or $_ -eq 'MD5' -or $_ -eq 'IMP' }) | Where-Object { $entry.$_ -and $entry.$_.Trim() -ne "" }
    $isUnsigned = ([string]::IsNullOrWhiteSpace($entry.Signer) -and $hasHash) -or ($entry.Signer -and $entry.Signer -like '*Not verified*')
    if ($isUnsigned -and -not (IsSignatureWhitelisted -entry $entry)) {
        $reasons += "Unsigned"
    }

    foreach ($bad in $KnownBadStrings) {
        foreach ($prop in $entry.PSObject.Properties.Name) {
            $val = $entry.$prop
            if ($val -and $val.ToLower().Contains($bad.ToLower())) {
                $reasons += "Suspicious String: $bad"
                break
            }
        }
        if ($reasons -contains "Suspicious String: $bad") {
            break
        }
    }

    # foreach ($ext in $SuspiciousExtensions) {
    #     if (($entry.'Image Path' -ne $null -and $entry.'Image Path'.ToLower().Contains($ext)) -or 
    #         ($entry.'Launch String' -ne $null -and $entry.'Launch String'.ToLower().Contains($ext))) {
    #         $reasons += "Suspicious Extension: $ext"
    #         break
    #     }
    # }

    if ($reasons.Count -eq 0) { return "None" }
    return ($reasons -join "; ")
}

foreach ($entry in $data) {
    $entry | Add-Member -NotePropertyName Flag -NotePropertyValue (Get-FlagReason -entry $entry) -Force
}

if (-not $All) {
    $outputEntries = $data | Where-Object { $_.Flag -ne "None" -and -not (IsWhitelisted $_) }
} else {
    $outputEntries = $data
}

if (-not $outputEntries -or $outputEntries.Count -eq 0) {
    Write-Host "[*] No suspicious autorun entries detected." -ForegroundColor Green
    exit 0
}

$baseProps = @("Time", "Date", "Hostname", "Flag")
$otherProps = $outputEntries[0].PSObject.Properties.Name | Where-Object { $_ -notin $baseProps }
$orderedProps = $baseProps + $otherProps
$outputEntries = $outputEntries | Select-Object $orderedProps

$timestamp = (Get-Date -Format 'yyyy-MM-dd_HHmmss')

if ($CSV) {
    $csvFile = Join-Path $env:TEMP "AutorunHunter_Suspicious-$timestamp.csv"
    $outputEntries | Export-Csv -Path $csvFile -NoTypeInformation -Force
    Write-Host "`n[+] Suspicious entries exported to CSV: $csvFile" -ForegroundColor Green
    if ($Open) {
        Start-Process -FilePath "explorer.exe" -ArgumentList $csvFile
    }
}

if ($XML) {
    $excelPath = Find-ExcelPath
    if (-not $excelPath) {
        Write-Warning "Excel not found, cannot export to Excel format."
    } else {
        $xlsxFile = Join-Path $env:TEMP "AutorunHunter_Suspicious-$timestamp.xlsx"
        $excel = New-Object -ComObject Excel.Application
        $excel.Visible = $false
        $workbook = $excel.Workbooks.Add()
        $sheet = $workbook.Sheets.Item(1)
        $headers = $outputEntries[0].PSObject.Properties.Name
        for ($col=0; $col -lt $headers.Count; $col++) {
            $sheet.Cells.Item(1, $col+1).Value2 = $headers[$col]
        }
        for ($row=0; $row -lt $outputEntries.Count; $row++) {
            for ($col=0; $col -lt $headers.Count; $col++) {
                $sheet.Cells.Item($row+2, $col+1).Value2 = $outputEntries[$row].$($headers[$col])
            }
        }
        $workbook.SaveAs($xlsxFile)
        $excel.Quit()
        [System.Runtime.Interopservices.Marshal]::ReleaseComObject($excel) | Out-Null
        Write-Host "`n[+] Suspicious entries exported to Excel: $xlsxFile" -ForegroundColor Green
        if ($Open) {
            Start-Process -FilePath "explorer.exe" -ArgumentList $xlsxFile
        }
    }
}

if ($Console) {
    ColorWrite-Suspicious -Entries $outputEntries
}

Write-Host "`n"
